/// <summary>
/// SaveToAttachmentsDocuType_DC lookup event handler.
/// </summary>
/// <param name="_sender">The sender form control.</param>
/// <param name="_e">The form control arguments.</param>
[FormControlEventHandler(formControlStr(SRSPrintDestinationSettingsForm, SaveToAttachmentsDocuType_DC), FormControlEventType::Lookup)]
public static void SaveToAttachmentsDocuType_DC_OnLookup(FormControl _sender, FormControlEventArgs _e)
{
    FormControlCancelableSuperEventArgs ce = _e as FormControlCancelableSuperEventArgs;
    ce.CancelSuperCall();

    FormRun fr = _sender.formRun();
    fr.SaveToAttachmentsDocuType_DC_OnLookup_DC(_sender);
}

